import React from 'react';
import ReactDOM from 'react-dom';

const img1 = "https://picsum.photos/800/500";
const img2 = "https://picsum.photos/800/501";
const img3 = "https://picsum.photos/800/500";

ReactDOM.render(
  <>
    <h1 contentEditable = "true">
      Hello My Name is Nand Makadia
    </h1>
    <br/>
    <h2> This is React</h2>
    <br/>
    <img src={img1} alt="This is Lorem Images"/>
    <img src={img2} alt="This is Lorem Images"/>
    <img src={img3} alt="This is Lorem Images"/>
  </>
  ,
  document.getElementById("root")
)
